import {useRouter} from 'next/router'

import MainLayout from '@/components/layouts/MainLayout'


const PostPage = () => {
  const router = useRouter()

  const meta = {
    title: 'a',
    keywords: [
      'a'
    ],
    description: 'a'
  }

  console.log();

  return <>
    <MainLayout meta={meta}>
      <pre>
        {JSON.stringify(router.query.content, null, 2)}
      </pre>
    </MainLayout>
  </>
}

export default PostPage
